var log = logrus.New()
var INFO_LOG = logrus.New()

func init() {
	// for debug level
	log.Formatter = new(logrus.TextFormatter) // default
	file, err := os.OpenFile("logrus.log", os.O_CREATE|os.O_WRONLY, 0666)
	if err == nil {
		log.Out = file
	} else {
		log.Info("Failed to log to file, using default stderr")
	}
	log.Level = logrus.InfoLevel

	// for info level
	INFO_LOG.Formatter = new(logrus.TextFormatter)
	publicFile, err := os.OpenFile("public.log", os.O_CREATE|os.O_WRONLY, 0666)
	if err == nil {
		INFO_LOG.Out = publicFile
	} else {
		log.Info("Failed to log to file, using default stderr")
	}
	INFO_LOG.Level = logrus.InfoLevel
}

